import React from "react";
import { Router, Route } from "react-router-dom";
import "./App.css";
import { HomePage } from "./pages";

function App() {
  return (
    <Router>
      <div className="App">
        <Route exact path="/" component={HomePage} />
      </div>
    </Router>
  );
}

export default App;
